#include <iostream>
#include <vector>
#include <string>

using namespace std;

struct Node {
    int key;
    Node* left;
    Node* right;
};

class BinarySearchTree {
public:
    Node* root;

    BinarySearchTree() {
        root = nullptr;
    }

    void insert(int key) {
        root = insertNode(root, key);
    }

    bool find(int key) {
        return findNode(root, key);
    }

    void printInorder() {
        printInorderNode(root);
        cout << endl;
    }

    void printPreorder() {
        printPreorderNode(root);
        cout << endl;
    }

private:
    Node* insertNode(Node* node, int key) {
        if (node == nullptr) {
            node = new Node();
            node->key = key;
            node->left = nullptr;
            node->right = nullptr;
        } else if (key < node->key) {
            node->left = insertNode(node->left, key);
        } else if (key > node->key) {
            node->right = insertNode(node->right, key);
        }
        return node;
    }

    bool findNode(Node* node, int key) {
        if (node == nullptr) {
            return false;
        } else if (key == node->key) {
            return true;
        } else if (key < node->key) {
            return findNode(node->left, key);
        } else {
            return findNode(node->right, key);
        }
    }

    void printInorderNode(Node* node) {
        if (node != nullptr) {
            printInorderNode(node->left);
            cout << node->key << " ";
            printInorderNode(node->right);
        }
    }

    void printPreorderNode(Node* node) {
        if (node != nullptr) {
            cout << node->key << " ";
            printPreorderNode(node->left);
            printPreorderNode(node->right);
        }
    }
};

int main() {
    int m;
    cin >> m;
    BinarySearchTree bst;
    while (m--) {
        string op;
        cin >> op;
        if (op == "insert") {
            int key;
            cin >> key;
            bst.insert(key);
        } else if (op == "find") {
            int key;
            cin >> key;
            if (bst.find(key)) {
                cout << "yes" << endl;
            } else {
                cout << "no" << endl;
            }
        } else if (op == "print") {
            bst.printInorder();
            bst.printPreorder();
        }
    }
    return 0;
}
